INSERT INTO `adverts` VALUES (49,6,'cours-et-soutien-en-francais-et-lettres-modernes-par-professeur-agrege-de-mathematique','Cours et soutien en Français et Lettres modernes par professeur agrégé de Lettres','Bonjour,\r\nJe suis titulaire de l\'Education Nationale en Lettres Modernes et diplômée d\'un Master 2 en philosophie esthétique. En poste depuis de nombreuses années en collège et lycée, j\'enseigne, pour cette année scolaire, le français à des élèves de 2de générales et 1ère S et L. Depuis deux ans, j\'enseigne également la synthèse littéraire de documents en école de commerce : j\'entraîne mes étudiants de 1ère et 2ème années aux concours Passerelle et Tremplin. Je suis intervenante dans une école de commerce réputée (8ème au classement général selon le magazine Challenges).\r\n\r\nPar ailleurs, ma pédagogie, mon excellente connaissance du programme et des notions s\'y rapportant ainsi que ma maîtrise de la méthodologie répondront à toutes vos attentes.\r\n\r\nEnfin, j\'ai eu la chance d\'avoir de nombreuses classes de différents niveaux au cours de mes expériences éducatives : en effet, par mon expérience de professeur à domicile mais également grâce aux élèves que je suivais les années précédentes aussi bien au collège qu\'au lycée et en école de commerce, il m\'a été donné d\'éprouver un large panel éducatif.\r\nTous mes cours sont assortis de documents et rigoureusement préparés. Je suis à la disposition de mes élèves par mail, webcam et téléphone. Je suis aussi là pour répondre à toutes questions annexes à la scolarité. Entraînement en situation d\'examen ou de concours (Diplôme National du Brevet, oral et écrit de l\'EAF, concours Tremplin et Passerelle) afin de se préparer dans des conditions optimales.\r\nN\'hésitez pas à me demander mes références (Education Nationale, école de commerce et cours particuliers).\r\nEn préparation de mon site (prévu pour mi-janvier 2016) : tarifs avantageux et conditions professionnelles de travail dans un local dédié !','COURS EN INDIVIDUEL :\r\n-- 40 € pour les collégiens,\r\n-- 50 € pour les lycéens,\r\n-- 60 € pour le supérieur.\r\nLe prix de la première heure de cours sera majoré de 5 euros pour un déplacement jusqu\'à 10km, de 10 euros pour un déplacement de plus de 10km.\r\nSi 10 heures sont payées d\'avance, une remise de 5% est appliquée.\r\n\r\nCOURS EN PETITS GROUPES DE TRAVAIL (de 5 à 6 élèves au maximum) :\r\n-- 55 € pour 2 heures (niveau collège).\r\n--100 € pour 4 heures (niveau collège).\r\n-- 75 € pour 2 heures (niveau lycée).\r\n-- 140 € pour 4 heures (niveau lycée).\r\n-- 95 € pour 2 heures (niveau supérieur).\r\n-- 180 € pour 4 heures (niveau supérieur).\r\nLes cours se déroulent dans un local dédié.\r\nSi 10 heures sont payées d\'avance, une remise de 5% est appliquée.\r\n\r\nSTAGES DE 10 HEURES SUR 5 JOURS EN PETITS GROUPES DE TRAVAIL (de 5 à 6 élèves au maximum) :\r\n-- 250 € (niveau collège).\r\n-- 350 € (niveau lycée).\r\n-- 450 € (niveau supérieur).\r\nLes cours se déroulent dans un local dédié.\r\nSi les 10 heures sont payées d\'avance, une remise de 5% est appliquée.','Mon parcours en quelques dates :\r\n2015-2016 : collaboratrice des éditions Le livre scolaire pour la rédaction du manuel scolaire de 3ème.\r\n2014-2016 : En charge des classes de 2de générales et 1ère S et L. Professeur principal et Coordinatrice du français au lycée. Intervenante en école de commerce pour la préparation au concours Passerelle et Tremplin.\r\n2014 : obtention de l\'Agrégation interne de Lettres Modernes.\r\n2013-2014 : Coordinatrice du français au collège.\r\n2007-2013 : Enseignante en lettres modernes et professeur principal. Depuis 2009, correctrice et examinatrice pour le Diplôme National du Brevet et le Baccalauréat.\r\n2006-2007 : Préparation au Capes de Lettres Modernes.\r\n2001-2006 : Etudiante. DEA (actuel Master 2) de philosophie esthétique. Mention Très bien avec félicitations du jury.\r\n2000-2001 : année sabbatique à l\'étranger.\r\n1998-2000 : Hypokhâgne et khâgne a/l au lycée Condorcet (75009).\r\n1998 : Bac littéraire en horaires aménagés au lycée Racine (75008). Mention Bien.',200,'50','250','5','950','10','1800',NULL,NULL,'','','48.8642858','2.37901880000004',10000,'75011','Paris','FR','78 Avenue de la République',NULL,NULL,NULL,'on',NULL,NULL,'2016-01-02 20:33:17',NULL,'2016-01-02 18:40:13','2016-01-02 20:33:17',NULL),(382,6,'laborum-laudantium-ea-quos-numquam-nisi-ea-quibusdam-vel-itaque-quidem-quo-quisquam-id','Arithmétique - Laborum laudantium ea quos numquam nisi ea quibusdam vel itaque quidem quo quisquam id.','Incidunt est aliquam harum numquam ea voluptate occaecati eveniet. Et quis facilis dolores. Et facilis iusto est et officiis est rem. Ut ut quas impedit nemo iste. Placeat cupiditate dolores quia et. Ea cumque qui adipisci in. Est quia id iste autem commodi. Quae eos excepturi voluptatum consectetur. Consectetur quidem dolor vel. Nihil quia rem tempore quidem aliquid quo. Optio omnis a suscipit eos non. Doloribus dolorum non molestiae. Occaecati exercitationem voluptates ut quaerat voluptas repudiandae. Neque officiis nulla incidunt. Voluptas facere beatae magnam quos aut vel laboriosam.','Excepturi adipisci saepe est adipisci voluptatem expedita. Illo id quas recusandae ullam eos nihil et. Quaerat provident officiis harum aut. Voluptate dolore voluptatem aut delectus qui accusamus. Inventore quibusdam fugiat aspernatur qui sequi. Eos tempore voluptatum id sapiente quia enim. Nemo eos deserunt unde. Minima blanditiis voluptatem veritatis numquam nemo. Doloremque est omnis laudantium consequatur quae et. Provident officiis occaecati et.','Culpa recusandae natus earum vitae ipsum non. Culpa sint vel non illo. Earum libero non error eos architecto veniam omnis. Deleniti qui aut quia officiis sint blanditiis. Occaecati consequatur accusamus repudiandae eveniet et. Quis excepturi accusantium sint omnis. Commodi et quis qui molestiae iste facilis. Ut voluptas aut ut. Est neque numquam unde. Eaque non ad acc